import Navbar from "./components/Navbar";
import "./App.css";
import { Routes } from "react-router-dom";


function App() {
  return (
    <div className="App">
    <Router>
    <Navbar />
    <Routes>
    <Route path="/" exact />
    </Routes>
  </Router>
    </div>
  );
}

export default App;
